import { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const AddMarks = () => {
    const [studentId, setStudentId] = useState("");
    const [marks, setMarks] = useState({
        subject1: "",
        subject2: "",
        subject3: "",
        subject4: "",
        subject5: "",
    });
    const navigate = useNavigate();

    const refreshToken = async () => {
        const refreshToken = localStorage.getItem("refresh_token");

        if (!refreshToken) {
            console.log("No refresh token found");
            return null;
        }

        try {
            const response = await axios.post(
                "http://127.0.0.1:8000/api/token/refresh/",
                { refresh: refreshToken }
            );
            const { access, refresh } = response.data;
            localStorage.setItem("token", access);
            localStorage.setItem("refresh_token", refresh);
            return access;
        } catch (error) {
            console.error("Error refreshing token:", error.response?.data || error.message);
            alert("Session expired. Please log in again.");
            navigate("/login");
            return null;
        }
    };

    const retryRequest = async (newToken) => {
        return axios.post(
            "http://127.0.0.1:8000/api/marks/", 
            {
                student_id: studentId, 
                ...marks,
            },
            {
                headers: { Authorization: `Bearer ${newToken}` },
            }
        );
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        let token = localStorage.getItem("token");

        if (!token) {
            alert("You are not authorized. Please log in.");
            navigate("/login");
            return;
        }

        const formattedMarks = {
            subject1: Number(marks.subject1),
            subject2: Number(marks.subject2),
            subject3: Number(marks.subject3),
            subject4: Number(marks.subject4),
            subject5: Number(marks.subject5),
        };

        const isValidMarks = Object.values(formattedMarks).every(mark => !isNaN(mark) && mark !== "");

        if (!isValidMarks) {
            alert("Please enter valid marks for all subjects.");
            return;
        }

        try {
            await axios.post(
                "http://127.0.0.1:8000/api/marks/", 
                {
                    student_id: studentId, 
                    ...formattedMarks,
                },
                {
                    headers: { Authorization: `Bearer ${token}` },
                }
            );
            alert("Marks Added Successfully!");
            navigate("/marks-list");
        } catch (error) {
            console.error("Error adding marks:", error.response?.data || error.message);

            if (error.response?.status === 401) {
                const newToken = await refreshToken();
                if (newToken) {
                    try {
                        await retryRequest(newToken);
                        alert("Marks Added Successfully!");
                        navigate("/marks-list");
                    } catch (retryError) {
                        console.error("Retry failed:", retryError.response?.data || retryError.message);
                        alert("Failed to add marks. Try again.");
                    }
                } else {
                    alert("Failed to refresh token. Please log in again.");
                }
            } else {
                alert(error.response?.data?.detail || "Failed to add marks. Try again.");
            }
        }
    };

    return (
        <div className="container mt-5">
            <div className="row justify-content-center">
                <div className="col-md-6">
                    <div className="card p-4 shadow">
                        <h2 className="text-center mb-4">Add Marks</h2>
                        <form onSubmit={handleSubmit}>
                            <div className="mb-3">
                                <input
                                    type="number"
                                    className="form-control"
                                    required
                                    placeholder="Student ID"
                                    value={studentId}
                                    onChange={(e) => setStudentId(e.target.value)}
                                />
                            </div>
                            {Object.keys(marks).map((subject, index) => (
                                <div className="mb-3" key={index}>
                                    <input
                                        type="number"
                                        className="form-control"
                                        required
                                        placeholder={`Subject ${index + 1} Marks`}
                                        value={marks[subject]}
                                        onChange={(e) => setMarks({ ...marks, [subject]: e.target.value })}
                                    />
                                </div>
                            ))}
                            <button type="submit" className="btn btn-success w-100">
                                Add Marks
                            </button>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AddMarks;
